import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="nav-container">
      <div className="nav-left">
        <NavLink to="/">
          <img src="./img/logo.png" alt="" className="logo" />
        </NavLink>
      </div>
    </div>
  );
};

export default Navbar;
